import {useEffect, useState} from "react";
import api from "../services/api";



export default function Home({ history }){
    const [summoner, setSummoner] = useState("")

    useEffect(() => {
        api.get('').then((res) => console.log(res.data)).catch(e => console.log("porra"));
    }, []);
    return (
        <form method="post">
            <input id="GET-name" type="text" name="name" value={summoner} onChange={(e) => setSummoner(e.target.value)}/>
            <button
            type="button"
            onClick={() => history.push(`/summoner/${summoner}`)}
            >
                <strong>BUSCAR</strong>
            </button>
        </form>
    )
}
